    return (
        <div>


            <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
                <Label for="examplePassword" className="mr-sm-2">New Todo :</Label>
                <Input type="text" name="todo" id="examplePassword" placeholder="Enter new todo"/>
            </FormGroup>
            <br/>
            <Button style={{margin: '10px'}} color={'success'}>Submit</Button>
            <Button color={'info'}>delete</Button>


        </div>
    );
};

export default TodoForm;
